import moment from 'moment';

const Earning = ({earning}) => {
    return (
        <div className="table">
            <span>22/4/2001</span>
            <span>23/3/2003</span>
            <span>{earning.note}</span>
            <span>{earning.amount}</span>
        </div>
    );
}

export default Earning;
